import React from "react";
import LOGO from "../assets/Login.jpeg";
import { Input } from "antd";

export const Login = () => {
  return (
    <div className="flex h-screen">
      <div className="w-[40%] ">
        <img src={LOGO} alt="Login image not loading" />
      </div>
      <div className="w-[60%]">
        <div className="flex justify-end p-2 mr-2 gap-2 ">
          Already a member? <a>Sign in</a>
        </div>
        <div className="flex flex-col justify-center mt-[40px]  gap-4">
          <div className="flex flex-col justify-start ">
            <div className="text-2xl  font-semibold">Sign up to Dribble</div>
            <div>Username has already been taken</div>
          </div>    
          <div className="flex-col flex gap-4">
            <Input placeholder="Enter Email" className="w-[300px]" />
            <Input placeholder="Enter Email" className="w-[300px]" />
            <Input placeholder="Enter Email" className="w-[300px]" />
          </div>
        </div>
      </div>
    </div>
  );
};
